  "source": "//SPDX-License-Identifier: GPL-3.0\n\npragma solidity >=0.5.0 <0.9.0;\n\ncontract whatsappBC {\n    string public teststring;\n\n    struct Message {\n        string content;\n        address from;\n        address to;\n        uint timestamp;\n    }\n\n    struct MessageDemo {\n        string content;\n        address from;\n        address to;\n        string timestamp;\n    }\n\n    // just for demo\n    mapping(address => MessageDemo) singleMessageMapping;\n    string public msgToUser1;\n    string public msgToUser2;\n\n    // Here the key 'address' stores the 'to' filed - that is 'to whom' the message has been sent\n    mapping(address => Message[]) messagesByToAddress;\n\n    Message[] public allMessagesList;\n\n    constructor() {\n        teststring = \"\";\n        msgToUser1 = \"\";\n        msgToUser2 = \"\";\n    }\n\n    function getstring() public view returns (string memory) {\n        return teststring;\n    }\n\n    function setteststring(string memory arg) public {\n        teststring = arg;\n    }\n\n    function testfxn() public pure returns (uint) {\n        return 568111;\n    }\n\n    function getMessagesCount() public view returns (uint) {\n        return allMessagesList.length;\n    }\n\n    // dummy just for demo\n    function sendMessageDummy(\n        string memory msgContent,\n        string memory instant,\n        address toWhom\n    ) public {\n        MessageDemo memory myStruct = MessageDemo({\n            content: msgContent,\n            from: msg.sender,\n            to: toWhom,\n            timestamp: instant\n        });\n\n        singleMessageMapping[toWhom] = myStruct;\n    }\n\n    // just for demo - too much trouble - so resorting to this -\n    function getLatestMessageSentToUser1() public view returns (string memory) {\n        return msgToUser1;\n    }\n\n    // just for demo - too much trouble - so resorting to this -\n    function getLatestMessageSentToUser2() public view returns (string memory) {\n        return msgToUser2;\n    }\n\n    // just for demo - too much trouble - so resorting to this -\n    function sendMessageToUser1(string memory msgContent) public {\n        msgToUser1 = msgContent;\n    }\n\n    // just for demo - too much trouble - so resorting to this -\n    function sendMessageToUser2(string memory msgContent) public {\n        msgToUser2 = msgContent;\n    }\n\n    // just for demo\n    function getMessagesDemo() public view returns (string memory) {\n        string memory msgsStringified = string(\n            abi.encodePacked(\n                singleMessageMapping[msg.sender].content,\n                \"xpxz\",\n                abi.encodePacked(singleMessageMapping[msg.sender].from),\n                \"xpxz\",\n                singleMessageMapping[msg.sender].timestamp\n            )\n        );\n\n        // singleMessageMapping[msg.sender].content = \"xxx\";\n\n        return msgsStringified;\n    }\n\n    function sendMessage(string memory msgContent, address toWhom) public {\n        // require(msg.sender != toWhom, \"Cannot send message to yourself.\");\n        Message memory myStruct = Message({\n            content: msgContent,\n            from: msg.sender,\n            to: toWhom,\n            timestamp: block.timestamp\n        });\n\n        messagesByToAddress[toWhom].push(myStruct);\n    }\n\n    // from address param is not necessary - it will be msg.sender  automatically\n    function getMsgsCountByToAddress() public view returns (uint) {\n        return messagesByToAddress[msg.sender].length;\n    }\n\n    // from address param is not necessary - it will be msg.sender  automatically\n    function getAllMsgsByToField() public view returns (string memory) {\n        string memory msgsStringified = \"\";\n\n        uint totalCount = messagesByToAddress[msg.sender].length;\n\n        for (uint i = 0; i < totalCount; i++) {\n            string memory temp = string(\n                abi.encodePacked(\n                    messagesByToAddress[msg.sender][i].content,\n                    \"xpxz\",\n                    messagesByToAddress[msg.sender][i].from,\n                    \"xpxz\",\n                    messagesByToAddress[msg.sender][i].timestamp\n                )\n            );\n\n            // string memory temp = messagesByToAddress[msg.sender][i].content\n            msgsStringified = string.concat(\n                string.concat(msgsStringified, \"xpzkx\"),\n                temp\n            );\n        }\n        return msgsStringified;\n    }\n\n    // old function\n    // function addMessage(string memory chatMessage, address toWhom) public {\n    //     Message memory myStruct = Message({\n    //         content: chatMessage,\n    //         from: msg.sender,\n    //         to: toWhom,\n    //         timestamp: block.timestamp\n    //     });\n\n    //     allMessagesList.push(myStruct);\n    // }\n\n    // old function\n\n    // function getMessageAtIndexOfUser(\n    //     address user\n    // ) public view returns (string memory) {\n    //     string memory mesg = \"\";\n    //     uint totalCount = allMessagesList.length;\n    //     for (uint i = 0; i < totalCount; i++) {\n    //         if (allMessagesList[i].to == user) {\n    //             // mesg = allMessagesList[i].content;\n    //             mesg = string.concat(\n    //                 string.concat(mesg, \"xzxzxz\"),\n    //                 allMessagesList[i].content\n    //             );\n    //         }\n    //     }\n    //     return mesg;\n    // }\n}\n",
